import React from 'react';
import { motion } from 'framer-motion';
import { 
  CheckCircle,
  Rocket,
  Shield,
  Crown
} from 'lucide-react';

const Services = () => {
  const services = [
    {
      icon: Rocket,
      title: 'Google Maps PowerBoost ðŸš€',
      description: 'Advanced Google Business Profile (GMB/GBP) strategy to help you rank in the Map Pack and dominate your local area.',
      features: [
        '300 Local Geotagged Google Map Points',
        '15â€“45 mile radius maps + 5-mile bonus radius',
        '20 driving direction paths embedded',
        '10 Geotagged images inside Google MyMaps',
        'NAP embedded, Video + Photo Stacking',
        '99 High DA backlinks with CID link indexing',
        '30-Day Drip Feed & SEO Recommendations'
      ],
      price: '$347',
      priceType: 'One-time optimization',
      cta: 'Boost My Local Ranking',
      isPremium: true
    },
    {
      icon: Shield,
      title: 'Google Authority Embeds Package ðŸ”—',
      description: 'Supercharge your local rankings with 800+ iframe stacked map embeds and Web 2.0 backlinks â€” all safely drip-fed over 30 days using our SSF (Slow Safe Stacking) strategy.',
      features: [
        '800x iFrame Stacking Map Embeds',
        'Geotagged YouTube Video Embeds',
        'Web 2.0 Links from DA 20â€“30+ Sites',
        'High DA Do-Follow Tiered Backlinks',
        'Fully Search Engine Safe & Friendly',
        '30-Day Drip Feed via Indexification',
        'Google Sheet Backlink Report',
        'Full Indexing Verification Instructions'
      ],
      price: '$347',
      priceType: 'One-time strategy deployment',
      cta: 'Launch Authority Boost',
      isPremium: true
    },
    {
      icon: Crown,
      title: 'Local SEO Domination Package ðŸ‘‘',
      description: 'The ultimate local SEO solution combining both PowerBoost and Authority Embeds for complete market domination. Get the best of both worlds with maximum results.',
      features: [
        'Everything from Google Maps PowerBoost',
        'Everything from Authority Embeds Package',
        'Priority implementation & support',
        'Dedicated account manager',
        'Weekly progress reports',
        '60-day results guarantee',
        'Custom strategy consultation',
        'Exclusive access to advanced techniques'
      ],
      price: '$597',
      priceType: 'Complete domination package',
      cta: 'Dominate My Market',
      isPremium: true,
      isUltimate: true
    }
  ];

  return (
    <section id="services" className="section-padding bg-gray-50">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl lg:text-5xl font-bold text-gray-900 mb-6 tracking-tight">
            What We Do
          </h2>
          <p className="text-xl lg:text-2xl text-gray-600 max-w-4xl mx-auto leading-relaxed font-light">
            Our comprehensive local SEO services are designed to get your business found by the right customers at the right time.
          </p>
        </motion.div>

        {/* Services Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8 max-w-7xl mx-auto">
          {services.map((service, index) => (
            <motion.div
              key={service.title}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              viewport={{ once: true }}
              whileHover={{ y: -5 }}
              className={`card p-8 group ${
                service.isUltimate 
                  ? 'ring-2 ring-purple-500 bg-gradient-to-br from-purple-50 to-white lg:col-span-1' 
                  : service.isPremium 
                    ? 'ring-2 ring-orange-500 bg-gradient-to-br from-orange-50 to-white' 
                    : ''
              }`}
            >
              {/* Premium Badge */}
              {service.isUltimate && (
                <div className="absolute -top-3 -right-3">
                  <div className="bg-gradient-to-r from-purple-500 to-pink-500 text-white px-3 py-1 rounded-full text-xs font-semibold">
                    Ultimate
                  </div>
                </div>
              )}
              {service.isPremium && !service.isUltimate && (
                <div className="absolute -top-3 -right-3">
                  <div className="bg-gradient-to-r from-orange-500 to-red-500 text-white px-3 py-1 rounded-full text-xs font-semibold">
                    Premium
                  </div>
                </div>
              )}

              {/* Icon */}
              <div className={`w-16 h-16 rounded-xl flex items-center justify-center mb-6 group-hover:scale-110 transition-transform duration-300 ${
                service.isPremium 
                  ? 'bg-gradient-to-br from-orange-500 to-red-500' 
                  : 'bg-gradient-to-br from-primary-500 to-orange-500'
              }`}>
                <service.icon className="w-8 h-8 text-white" />
              </div>

              {/* Title */}
              <h3 className="text-xl font-bold text-gray-900 mb-4 tracking-tight">
                {service.title}
              </h3>

              {/* Description */}
              <p className="text-gray-600 mb-6 leading-relaxed text-base">
                {service.description}
              </p>

              {/* Features */}
              <ul className="space-y-2 mb-6">
                {service.features.map((feature) => (
                  <li key={feature} className="flex items-center text-sm text-gray-600">
                    <CheckCircle className="w-4 h-4 text-green-500 mr-3 flex-shrink-0" />
                    {feature}
                  </li>
                ))}
              </ul>

              {/* Pricing and CTA for Premium Services */}
              {service.isPremium && (
                <div className="mt-auto">
                  <div className="mb-4">
                    <p className="text-2xl font-bold text-gray-800">{service.price}</p>
                    <p className="text-sm text-gray-500">{service.priceType}</p>
                  </div>
                  <motion.button
                    whileHover={{ scale: 1.02 }}
                    whileTap={{ scale: 0.98 }}
                    className="w-full py-3 px-6 rounded-lg font-semibold text-white bg-gradient-to-r from-orange-500 to-red-500 hover:shadow-lg transition-all duration-300"
                  >
                    {service.cta}
                  </motion.button>
                  <div className="mt-2 flex justify-center">
                    <a
                      href={service.title.includes('PowerBoost') ? '/services/google-maps-powerboost' : '/services/google-authority-embeds'}
                      className="text-sm text-orange-600 hover:underline font-medium"
                    >
                      Learn More
                    </a>
                  </div>
                </div>
              )}
            </motion.div>
          ))}
        </div>

        {/* CTA Section */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mt-16"
        >
          <div className="bg-white rounded-2xl p-8 shadow-lg border border-gray-100 max-w-2xl mx-auto">
            <h3 className="text-2xl font-bold text-gray-900 mb-4">
              Ready to Dominate Local Search?
            </h3>
            <p className="text-gray-600 mb-6">
              Get a free local SEO audit and discover how we can help your business get found by more local customers.
            </p>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="btn-primary"
            >
              Get Your Free Audit
            </motion.button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Services;
